import React, {useState} from 'react'
import {getNotes} from '../utils/noteHelpers'
import ListGroup from 'react-bootstrap/ListGroup'
export default function List() {
  return (
    <ListGroup>
      {getNotes().map((note) => (
        <ListGroup.Item action variant="primary">
          {note.title}
        </ListGroup.Item>
      ))}
    </ListGroup>
  )
}
